import React, { useState } from 'react';
import './Home.css';
import Recents from './Recents';  // Recents bileşenini ekliyoruz
import Agenda from './Agenda'; // Agenda bileşenini ekliyoruz
import Dashboard from '../pages/Dashboard'; // Eğer Dashboard 'pages' klasöründeyse


const Home = () => {
  const [projects, setProjects] = useState([]); // Projeleri state'e ekliyoruz

  return (
    <div className="home-page">
      <h1>Good evening, Kaan</h1>
      <div className="grid-container">
        <Recents projects={projects} setProjects={setProjects} />  {/* Recents bileşenini kullan */}
        <Agenda />   {/* Agenda bileşenini kullan */}
        {projects.length > 0 && <Dashboard projects={projects} />}  {/* Proje varsa Dashboard'u göster */}
        <div className="card">
          <h2>My Work</h2>
          <p>Tasks and reminders assigned to you will show here.</p>
          <button>Add task or reminder</button>
        </div>
        <div className="card">
          <h2>Assigned to me</h2>
          <p>Tasks assigned to you will appear here.</p>
          <button>Add task</button>
        </div>
      </div>
    </div>
  );
};

export default Home;
